import React from "react";
import Flag from "react-world-flags";
export default function MoreDetailsProject() {
  const { codeCountry, idProject, multimedia } = useParams();

  return (
    <div className="container">
      <>
        <h1>
          <Flag
            code={codeCountry}
            height="70"
            width="70"
            style={{ marginRight: "2px" }}
            className="flag"
          />
          Technical Details
        </h1>
      </>
    </div>
  );
}
